import React, {Component} from 'react';
import './../CSS/Timeline.css'

function NewsFeed(props){
    return(
        <div className="post">
            <img src= {props.value.urlToImage}/>
            <div>Source : {props.value.source.name}</div>
            <div>Author : {props.value.author}</div>
            <div>Title : {props.value.title}</div>
            <div>Description : {props.value.description}</div>
            <div>Publish Time : {props.value.publishedAt}</div>
            <div>Content : {props.value.content}</div>

        </div>
    );


}

export default NewsFeed;
